webpackJsonp([0x62fe288d0170],{344:function(n,a){n.exports={data:{site:{siteMetadata:{navigation:[{path:"/",title:"okidoc"}]}},page:{frontmatter:{layout:null,title:"",include:null},headings:[{depth:1,value:"okidoc"},{depth:2,value:"Installation"}],html:'<h1 id="okidoc"><a href="#okidoc" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>okidoc</h1>\n<p>Documentation tool</p>\n<h2 id="installation"><a href="#installation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Installation</h2>\n<p>Install using the <a href="https://www.npmjs.com/" target="_blank" rel="nofollow noopener noreferrer">npm</a> package manager:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sh"><code class="language-sh">$ npm install okidoc --save-dev</code></pre>\n      </div>\n<p>This installs package and put two commands in your <code>./node_modules/.bin</code> path:</p>\n<ul>\n<li><code>okidoc-md</code> - generate human-readable documentation <code>md</code> files using source code with <a href="http://usejsdoc.org" target="_blank" rel="nofollow noopener noreferrer">JSDoc</a> and public method markers</li>\n<li><code>okidoc-site</code> - run and build documentation site based on <code>md</code> files and site config</li>\n</ul>\n<p>You can use these commands in your <a href="https://docs.npmjs.com/misc/scripts#examples" target="_blank" rel="nofollow noopener noreferrer">npm scripts</a>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code class="language-json"><span class="token property">"scripts"</span><span class="token operator">:</span> <span class="token punctuation">{</span>\n  <span class="token property">"documentation"</span><span class="token operator">:</span> <span class="token string">"okidoc-md ./docs.yml ./docs"</span><span class="token punctuation">,</span>\n  <span class="token property">"documentation:gitadd"</span><span class="token operator">:</span> <span class="token string">"npm run documentation &amp;&amp; git add ./docs"</span><span class="token punctuation">,</span>\n  <span class="token property">"documentation:site"</span><span class="token operator">:</span> <span class="token string">"okidoc-site develop ./site.yml"</span><span class="token punctuation">,</span>\n  <span class="token property">"documentation:site:build"</span><span class="token operator">:</span> <span class="token string">"npm run documentation &amp;&amp; okidoc-site build ./site.yml"</span><span class="token punctuation">,</span>\n  <span class="token property">"precommit"</span><span class="token operator">:</span> <span class="token string">"npm run documentation:gitadd"</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>You can find documentation here: <a href="https://wix.github.io/okidoc/" target="_blank" rel="nofollow noopener noreferrer">https://wix.github.io/okidoc/</a></p>'}},pathContext:{slug:"/README/"}}}});
